import AnimalItem from './AnimalItem';

const AnimalList = ({ animals }) => {
  if (animals.length === 0) {
    return <h2>アニマルが見つかりません</h2>;
  }

  return (
    <ul>
      {animals.map((animal) => {
        return <AnimalItem key={animal} animal={animal} />;
      })}
    </ul>
  );
};

export default AnimalList;
